import { SimpleGrid, ListItem, CloseButton, Flex } from '@chakra-ui/core';

const Item = (props) => {
  return (
    <ListItem>
      <SimpleGrid columns="3">
        <Tex>{props.product}</Tex>
        <Tex>{props.quantity}</Tex>
        <Flex justify="center">
          <CloseButton />
        </Flex>
      </SimpleGrid>
    </ListItem>
  );
};

export default Item;
